import React, { useState, useEffect } from 'react';
// import { Navigate } from 'react-router';
import { Card, Button } from 'react-bootstrap';
import axios from 'axios';

const Gallery = (props) => {

    const [images, setImages] = useState([]);

    useEffect(() => {
        let email = localStorage.getItem('email');
        let token = localStorage.getItem('token');

        const headers = {
            'Content-Type': 'application/json',
            'Authorization': 'Bearer ' + token
        }

        axios.get("http://localhost:8060/image/fetch/" + email, {
            headers: headers
        }).then(response => {
            console.log(response.data);
            setImages(response.data.payload);
        }).catch(error => console.log(error.message));
    }, []);

    // if (!props.loggedIn) {
    //     return <Navigate to="/login" />
    // }

    return (
        <div  className="d-flex justify-content-around">
            {images.map(image => (
                <Card style={{ width: '18rem' }}>
                    {/* <Card.Img className="img-fluid" variant="top" src={"http://localhost:8060/image/18/display/" + image.url} /> */}
                    <Card.Body>
                        <Card.Title>{image.metadata.originalFileName}</Card.Title>
                        <Card.Text>
                            Some quick example text to build on the card title and make up the bulk of
                            the card's content.
                        </Card.Text>
                        <Button variant="primary">Go somewhere</Button>
                    </Card.Body>
                </Card>
                // <div key={image.id}>
                //     <p>{image.metadata.originalFileName}</p>
                //     <Image className="img-fluid rounded" name={image.url} src={"http://localhost:8060/image/18/display/" + image.url}
                //     onClick={(e) => alert(e.target.name)} width="250px" height="250px" />
                // </div>
            ))}
        </div>
    )
}

export default Gallery
